import React from "react";
import Slider from "react-slick";
import './slider.scss';


const SliderTemplates = (props) => {
    let template = null;
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
      ...props.settings
    }

    switch(props.type){
        case('city'):
          template = props.data.map((item,i) => {
            return(
              <div key ={i} className = "page" style={{width:'100%', background:'red', height:'540px'}}>
               <div style = {{backgroundImage:`url("images/city-section/slider-images/${item.image}.jpg")`, backgroundSize:'cover', width:'50%', height:'540px',background:'red'}}>
               hello
               </div>
              </div>
            )
          })
          break;
        default:
          template = null;
    }

    return (
      <div className ={`${props.type}-slider`}>
        <Slider {...settings}>
          {template}
        </Slider>
      </div>
    );
}

export default SliderTemplates;
